(1, 'adasd', 'Physical', 'aadad', '2023-09-01 16:11:00', '2023-09-14 18:13:00', 101, 21, 2145, 'asda', 'asd', 'domestic', '1695721025.jpeg', '1695721025_banner_.jpeg', '#', '0', 'pending'),
(2, 'HACKATHON 2.0', 'Physical', 'Spark incubation center sagar near by old RTO office.', '2023-06-28 07:30:00', '2023-06-28 22:38:00', 101, 21, 2408, 'At Bundelkhand Spark HACKATHON 2.0, an engaging Panel Discussion was held, centered around the theme of \"Best Practices for creating Sustainable Startup Ecosystem in Smaller Towns.\"\r\nStartups witnessed the active participation of all our esteemed jury members ,the lots of fun, thrill, enjoyment, knowledge and what not at just one point which is the  biggest hackathon for the year 2023 “Bundelkhand Spark Hackathon 2.0” which is being organized by Sagar Smart City Limited & SPARK Incubation Centre.', '#BundelkhandSparkHackathon,#InnovationUnleashed,#Hackathon2023,#SPARKIncubationCenter,#SagarStartupPark,#StartupEcosystem,#UnleashYourCreativity', 'event_at_incubation', '1695727597.jpeg', '1695727597_banner_.jpeg', '#', '0', 'pending'),
(3, 'COMPANY FORMATION AND INTELLECTUAL PROPERTY REGISTRATION FOR STARTUPS ', 'Physical', 'SPARK Incubation Center, Near by old RTO Building.', '2023-07-05 12:00:00', '2023-07-05 13:30:00', 101, 21, 2408, 'The first seminar on Company Formation and Intellectual Property Registration was organized by the Spark team of Sagar Smart City in the new building of Spark Incubation, in which the startups associated with Spark Incubation were given detailed information on how they can make their startup a Private Limited Company, Limited Liability Partnership LLP, or Partnership Firm, as well as the value proposition and which market to choose for their product, session held on 05/07/23 By Mr. Rajat Gupta project in-charge of Spark Incubation Smartcity Sagar.\r\n', '#SPARKIncubationCenter,#SagarStartups,#StartupIndia,', 'event_at_incubation', '1695729689.jpeg', '1695729689_banner_.jpeg', '#', '0', 'pending'),
(4, 'Startups screening- Spark Incubation center sagar', 'Physical', 'Spark Incubation center sagar mp.', '2023-07-19 12:01:00', '2023-07-19 14:20:00', 101, 21, 2408, 'In this screening session, Spark Team Expert and Startup India Mentor Mr. Akhilender Rai was present who saw the idea presentation of all the startups and asked questions to them and all the startups answered them.\r\nThe screening session was attended by 5 startups who had registered through online through SPARK Incubation on 19/07/93 .\r\n', 'Sparkincubation,Smartcity,startups,facebookpage,T', 'event_at_incubation', '1695810547.jpeg', '1695810547_banner_.jpeg', '#', '0', 'pending'),
(5, 'Spark Screening ', 'Physical', 'Spark Incubation Center sagar mp.', '2023-07-20 11:01:00', '2023-07-20 16:01:00', 101, 21, 2408, 'The Spark Incubation Center recently organized a startup screening event featuring five innovative startups. The screening session was attended by prominent members, including Mr. Akhilendra Rai, who actively engaged with the startups by asking insightful questions and fostering valuable interactions.', '#Sparkincubation#Startup,facepage,twitterpage,linkdin', 'event_at_incubation', '1695811166.jpeg', '1695811166_banner_.jpeg', '#', '0', 'pending'),
(6, 'Center Visit By Kendriya Vidyalaya  Students', 'Physical', 'Spark Incubation center sagar', '2023-07-22 13:15:00', '2023-07-22 14:16:00', 101, 21, 2408, 'Kendriya Vidyalaya Sangathan (KVS) students recently visited an incubation center as part of their educational experience. During the visit, students had the opportunity to explore innovation and entrepreneurship in a real-world setting. They gained insights into how startups and innovative projects are nurtured from concept to execution. This visit aimed to inspire and educate students about the possibilities of entrepreneurship and innovation, potentially sparking their own creative ideas for the future.', '#SparkIncubation,#SPARKPAGE,#Facebookpage', 'domestic', '1695812299.jpeg', '1695812299_banner_.jpeg', '#', '0', 'pending'),
(7, 'Empowering Women Through Self-Employment', 'Physical', 'Girls Degree College, sagar, mp', '2023-07-24 12:45:00', '2023-07-24 14:46:00', 101, 21, 2408, 'Empowering Women Through Self-Employment on 24 july 2023\r\n\r\nIn an inspiring effort to empower girls and women with entrepreneurial skills and opportunities, a recent webinar was organized by Degree College sagar in partnership with Spark Incubation. The event aimed to shed light on the path of self-employment as a means to achieve economic independence .As a distinguished guest speaker Mr. Kanahaiya Raikwar (Project manager) shared their valuable insights and experiences, offering a firsthand account of the journey to becoming a successful self-employed individual. The webinar highlighted the challenges women may encounter in the world of self-employment while emphasizing the immense opportunities it presents.\r\n\r\nSpark Incubation, a catalyst for entrepreneurial success, was also a vital part of the event. They discussed their role in supporting aspiring women entrepreneurs and showcased success stories of women who have thrived under their guidance.\r\n\r\nThe event featured a dynamic panel discussion with successful women entrepreneurs and experts, providing a platform for sharing strategies, advice, and solutions to common challenges in self-employment.\r\n\r\nMoreover, resources, government schemes, and educational opportunities available for women seeking self-employment were shared, empowering participants with the tools and knowledge to take the first step towards entrepreneurial success.\r\nIn summary, this webinar served as a beacon of hope and education for girls and women aspiring to become self-reliant ', '#sparkincubation,#womenstartup#startupindiascheme', 'global', '1695979641.jpeg', '1695979641_banner_.jpeg', '#', '0', 'pending'),
(8, 'Center Visit ', 'Physical', 'Spark incubation center sagar, mp ', '2023-09-29 12:58:00', '2023-09-29 15:00:00', 101, 21, 2408, 'On September 27, 2023, Infinity College students embarked on an insightful journey during their visit to the Spark Incubation Center. This visit served as an eye-opening experience, exposing them to the world of innovation and entrepreneurship, igniting their passion for future endeavors.', '#inovation,#sparkincubation,#startups,                          ', 'event_at_incubation', '1695980459.jpeg', '1695980459_banner_.jpeg', '#', '0', 'pending'),
(9, 'Spark Incubation Center promotes innovation by incubating 30 promising startups', 'Physical', 'Spark Incubation Center sagar mp.', '2023-08-08 10:35:00', '2023-08-08 18:30:00', 101, 21, 2408, 'On August 8, 2023, 30 startups began their boarding journey at the incubation center, ready to nurture their entrepreneurial dreams.\r\nthe process of onboarding startups at a Spark incubation center and have completed the registration for sheet allocation with the Spark team. This is a positive step in the incubation process, and it typically involves several key activities:\r\n\r\nStartup Registration: Startups interested in joining the incubation center usually go through a registration process. This involves providing necessary information about the company, its founders, and its business model.\r\n\r\nInitial Screening: After registration, there is often an initial screening process to evaluate the compatibility of the startup with the goals and resources of the incubation center. This may involve reviewing the business plan, team, and market potential.\r\n\r\nSheet Allocation: It appears that you\'ve completed the registration for sheet allocation. This could refer to the allocation of physical office space (sheets or desks) within the incubation center to the registered startups. It\'s crucial to assign the right space to each startup based on their needs and preferences.\r\n\r\nIncubation Agreement: Once startups are accepted, they typically sign an incubation agreement with the center. This agreement outlines the terms and conditions of their stay, including the duration of incubation, services provided, and any equity or fee arrangements.\r\n\r\nMentoring and Support: Incubation centers often provide startups with access to mentors, resources, workshops, and networking opportunities to help them grow and succeed.\r\n\r\nMonitoring and Progress: Throughout the incubation period, the progress of startups is monitored. They may have regular check-ins or milestone reviews to ensure they are making progress toward their goals.\r\n\r\nDemo Days and Graduation: At the end of the incubation period, startups often have the opportunity to showcase their progress to potential investors and partners during demo days. Successful startups \"graduate\" from the incubation center when they are deemed ready to operate independently.\r\n\r\nIt\'s great that you\'ve completed the registration for sheet allocation with the Spark team. This suggests that startups are one step closer to benefiting from the resources and support your incubation center offers. If you have any specific questions or need further guidance on the incubation process, please feel free to ask.\r\n\r\n\r\n\r\n\r\n\r\n\r\nRegenerate.\r\n', '#SparkIncubationcenter#startup#facebookpage#twitterpage', 'domestic', '1695984365.jpeg', '1695984365_banner_.jpeg', '#', '0', 'pending'),
(10, 'SWAKSHATA SARVEKSHAN ABHIYAN FEEDBACK PROGRAM', 'Physical', 'SAGAR CITY', '2023-07-11 11:50:00', '2023-08-31 18:54:00', 101, 21, 2408, 'The Spark incubation team contributed their efforts to the Swachhata Sarvekshan feedback initiative as instructed by the Nigam Collector in Sagar. This initiative likely involves assessing and improving the cleanliness and sanitation standards in colleges and institutions within the district. Here\'s how the Spark incubation team might have contributed:\r\n\r\nData Collection: The team could have been involved in collecting data related to cleanliness and sanitation standards in colleges and institutions. This might include assessing the condition of restrooms, classrooms, common areas, and waste disposal practices.\r\n\r\nSurveys and Feedback: The team may have conducted surveys or gathered feedback from students, staff, and faculty members to understand their perspectives on cleanliness and sanitation. This feedback is valuable for identifying areas that need improvement.Overall, the contribution of the Spark incubation team in this initiative demonstrates their commitment to community development and their willingness to use their expertise to address important issues like cleanliness and sanitation in educational institutions. This kind of civic engagement is essential for the betterment of society and the local community.', '#NIGAMSAGAR#SMARTCITYSAGAR#SPARKINCUBATIONCENTER', 'global', '1695986816.jpeg', '1695986816_banner_.jpeg', '#', '0', 'pending'),
(11, 'Entrepreneurship Day', 'Physical', 'SPARK INCUBATION CENTER SAGAR', '2023-08-21 00:30:00', '2023-08-21 14:30:00', 101, 21, 2408, 'Conducted an Entrepreneurship Day Online session with a mentor and startups on August 21, 2023! It\'s an excellent initiative to promote entrepreneurship and provide valuable guidance and networking opportunities. that Entrepreneurship Day sessions are excellent opportunities to learn, network, and receive guidance from experienced mentors. Take advantage of the collective knowledge and experience present in the session to support the growth and success of your startup.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '#SPARK#STARTUPS#SMARTCITY#EntrepreneurshipDay', 'domestic', '1696496747.png', '1696496747_banner_.png', '#', '0', 'pending'),
(12, 'Webinar on \"How to startup\"', 'Physical', 'spark incubation center sagar', '2023-08-21 11:00:00', '2023-08-21 13:38:00', 101, 21, 2408, 'On 21-08-23 The Spark Team recently hosted an engaging and informative webinar dedicated to helping aspiring entrepreneurs kickstart their startup journeys. The session covered crucial aspects of launching and running a successful startup.\r\n\r\nKey Takeaways:\r\n\r\nIdea to Execution: The webinar emphasized the importance of transforming innovative ideas into actionable plans. It provided guidance on refining concepts and translating them into viable business models.\r\n\r\nMarket Research: Attendees learned about the significance of thorough market research to identify opportunities, target audiences, and competitors.\r\n\r\nBusiness Planning: Practical insights on developing a comprehensive business plan, setting achievable milestones, and managing resources effectively were shared.\r\n\r\nFunding Strategies: The Spark Team discussed various funding options, including bootstrapping, seeking investors, and crowdfunding, helping participants understand how to secure financial support.\r\n\r\nDigital Presence: Leveraging the power of online platforms for marketing, branding, and customer engagement was a focal point, with tips on building a strong digital presence.\r\n\r\nLegal and Compliance: The webinar touched on important legal considerations, such as business registration, contracts, and intellectual property protection.\r\n\r\nNetworking and Mentorship: Building a network of mentors and peers for guidance and support was highlighted as a valuable resource.\r\n\r\nQ&A Session: The event featured an interactive Q&A session where attendees had the opportunity to ask specific questions and receive expert advice.\r\n\r\nIn summary, the \"How to Start Up\" webinar by the Spark Team equipped participants with essential knowledge and practical insights to embark on their entrepreneurial journeys successfully.\r\n\r\nNext Steps:\r\n\r\nWebinar participants were encouraged to stay connected with the Spark Team for ongoing mentorship, resources, and opportunities to further develop their startup ideas.\r\n\r\n', '#sparkincubationsagar#smartcitysagar#startups', 'domestic', '1696497685.png', '1696497685_banner_.png', '#', '0', 'pending'),
(13, 'Webinar on \" What is Pricing Strategy”', 'Physical', 'SPARK incubation center sagar', '2023-10-02 05:00:00', '2023-10-02 06:00:00', 101, 21, 2408, 'On 2/10/23, Spark Incubation organized a webinar on \'What is Pricing Strategy\' in which Dr.Kishore Nuthalapati(Chief financial officer BEKEM infra projects pvt Ltd) was invited as the keynote speaker. \r\n\r\nHe explained in detail how you can take your startup forward. This can be done by keeping the pricing strategy good. Kishore ji said that every startup needs to understand its product and service first and along with that it also has to understand the costs and expenses involved in it. \r\n\r\nToday is the era of competition. This is the era in which you should assess the products of all types of competitors present in your market and also the rates of that product and then you should select the pricing of your product and services so that your customer can easily buy it and further.\r\n Kishore ji also explained this through many examples. This webinar was hosted by Mrs. Dewanshi Sharma.\r\n', '#sparkincubation, #smartcitysagar', 'domestic', '1699343458.jpg', '1699343458_banner_.jpg', '#', '0', 'pending'),
(14, 'Webinar on \" What is Estimating budget for  sales and marketing for startups”', 'Physical', 'SPARK incubation center sagar', '2023-10-09 16:00:00', '2023-10-09 17:00:00', 101, 21, 2408, 'webinar was organized by Spark Incubation on 9/10/23 on the topic What is the estimated budget for sales and marketing for startups. \r\n\r\n Mr. Harsh Rajnikant Patel was invited as the keynote speaker, who told that you Before starting any business or startup, you should understand that where and how you will spend the money and funding you have received and how much output you will get from it and you should distribute this money in different categories. That is going to cost you as per your requirement like how much you will have to spend in sales and marketing\r\n\r\nIn the life of a startup, you will have to understand very well that when and where to invest your money so that we can get maximum benefit and reach our customers also, hence you have to make a budget of where and how much money you will invest.\r\n\r\nIn marketing, you know who are your target customers and how can you target them, similarly you will invest more money in the same marketing and where you do not see your customer, you will invest less money and in the same way you will increase your output in sales. Will spend money while watching\r\nShri Harsh also explained by giving many examples.\r\n', '#sparkincubation, #startupindia #sagarsmartcity', 'domestic', '1699343966.jpg', '1699343966_banner_.jpg', '#', '0', 'pending'),
(15, ' Hackathon Event at BT Institute ', 'Physical', 'BTIRT COLLEGE SAGAR ', '2023-10-07 13:40:00', '2023-10-07 16:32:00', 101, 21, 2408, 'Physical Hackathon was organized at Babulal Tarabai Engineering College on 7/10/23 in which Spark Incubation was invited as guest and judge in which Spark Incubation presented.\r\nStudents presented their innovative ideas and were screened by SPARK and their ideas were given marks.\r\nAnd through Spark Incubation, they were also guided and encouraged as to how to move forward and how solving any problem can become your business and you can earn money and provide employment to others.\r\nAlong with this, information was also given about the facilities available in incubation and they were also asked to register their ideas.\r\n', '#sparkincubationcenter, #startups, #sagarsmartcity, #inovation', 'domestic', '1699344525.jpg', '1699344525_banner_.jpg', '#', '0', 'pending'),
(16, 'Physical Session at Incubation Center.', 'Physical', 'SPARK incubation center sagar', '2023-10-16 12:40:00', '2023-10-16 13:41:00', 101, 21, 2408, 'A meeting was held with the startups of Spark Incubation on 16/10/23 in which the events happening in Spark and the problems faced by the startups were discussed.\r\nThe startups started regularly working at the Spark Incubation Center with their team and we have also explained to them about SPARK\'s upcoming programs, Events, and the FREE credits offered by Spark Incubation Center.\r\n', '#STARTUPINDIA, #SAGARSTARTUPS,     #SPARKINCUBATION , #SMARTCITYSAGAR', 'domestic', '1699344981.jpg', '1699344981_banner_.jpg', '#', '0', 'pending'),
(17, 'Webinar on Importance of social media and  Digital Marketing.', 'Virtual', 'https://www.youtube.com/watch?v=OzhVz_7OjSY', '2023-10-30 14:00:00', '2023-10-30 15:13:00', 101, 21, 2408, 'On 30/10/23, a webinar was organized by Spark Incubation on the topic of Importance of social media and Digital Marketing in which Abhishek Karnik ji Fonder of Mad Result was invited as the keynote speaker. \r\n Mr. Abhishek told that in today\'s era, digital marketing plays a very important role. Earlier, offline marketing of any product used to cost a lot of money and its reach was limited to that limited area only, but today with the use of digital marketing, we can reach more and more customers and expand our business.\r\nHe also gave many examples  Abhishek told that you can use SEO in digital marketing so that when you search on Google, your website will appear first and explained by giving many more examples. that you can also do digital marketing using them. \r\nThis webinar was hosted by Mrs. Dewanshi Sharma on behalf of Spark Incubation.\r\n', '#sparkincubation, #smartcitysagar, #digitalworld', 'domestic', '1699346637.jpg', '1699346637_banner_.jpg', 'https://www.youtube.com/watch?v=OzhVz_7OjSY', '0', 'pending'),
(18, '\"Aarohini Cell\" Aarohini will be launched soon.', 'Physical', 'SPARK incubation center sagar', '2023-10-30 12:15:00', '2023-10-30 14:15:00', 101, 21, 2408, 'Date 30 Oct 23\r\nSpark Incubation Center of Sagar Smart City invited women from various self-help groups operating in Sagar City to provide detailed information about the various facilities and assistance provided by the Incubation Center to Aarohini Cell and women entrepreneurs.\r\nThe main objective of this program was to provide detailed information to the women about Aarohini Cell which is going to be started very soon by Spark Incubation Centre. “Aarohini” is an initiative for women which will help them move forward in the field of entrepreneurship. This will help women who want to start their own business and become self-reliant. They will also get training about different types of businesses.\r\nThe program started with the introduction of the Incubation Center and providing information about the center by Kanhaiya Rekwar, Project Manager of Spark Incubation Center. After that, Ms. In-charge of Arohini Cell. Sonu Thakur said that the special facilities and assistance provided by the government to women entrepreneurs can be availed through Aarohini Mahila Cell, it was shared in detail through the presentation that women can avail various facilities for their business from the center like - mentor support, IT support, help in marketing, arrangement of consultants etc. will be provided free of cost.\r\nMrs. Kalpana Srivastava, Committee Organizing Officer of Sagar Municipal Corporation, participated in this program as the chief guest and made her special contribution in bringing the incubation to volunteer women. At the end of the program, all the women were taken on a tour of the Spark Incubation Center and at the end the Spark team expressed gratitude to all the women.', '#Aarohini, #sparkincubationsagar, #womenstartups, #empoweringwomen', 'global', '1699347127.jpg', '1699347127_banner_.jpg', '#', '0', 'pending'),
(19, 'Disabled people know what startup is ?', 'Physical', ' District Disabled Rehabilitation Center Sagar.', '2023-09-05 12:25:00', '2023-09-05 14:25:00', 101, 21, 2408, 'Startup Bootcamp” was organized by the team of Spark Incubation Center for the disabled people at the District Disabled Rehabilitation Center Sagar.\r\nSpark Incubation of Sagar Smart City has organized a \"Startup Bootcamp\" for the disabled people at District Disabled Rehabilitation Center Sagar today on 5th September 2023 in which Spark Incubation\'s Project Manager Kanhaiya Raikwar (Startup India Mentor), and Rahul Rahul were the main speakers. Pathak (Startup Consultant) was present.\r\nIn this program, while explaining about startups to the disabled people, he said that startups mainly solve a problem and they are able to reach out to the people in a wider way, told the disabled people that Spark Incubation Center has been set up in Sagar city to help the startups. In the program, these people learned that keeping in mind what things they can create a startup idea, a good startup can be created keeping in mind the needs of people or the solution to their problems, you You can generate a good startup idea by keeping in mind your interest and your work efficiency.\r\nIn this program, people with disabilities were told what startups are, what is the main difference between small business and startup, how the incubation center helps you in monitoring, market strategy and funding of the startup in the beginning.\r\nAt the conclusion of this program, Joint Director of Social Justice Shri DS Yadav administered the oath to the people present to vote in the upcoming elections. Shanu Harshe, and Amit Nema ji along with other staff were present in the program.\r\n', '#smartcity, #startup, #skillindia', 'global', '1700118226.jpg', '1700118226_banner_.jpg', '#', '0', 'pending'),
(20, 'webinar on \'\'know your market and how to estimate  your target market.', 'Physical', 'SPARK incubation center sagar', '2023-09-04 12:41:00', '2023-09-04 13:42:00', 101, 21, 2408, 'On Sep. 4. 2023 webinar on \'\'know your market and how to estimate your target market. by Mr. Ashok Pamidi CEO of NASSCOM foundation and host by Mr. AKHILENDRA Rai.', '#startup, #sparkincubation, #skillindia', 'domestic', '1700119858.jpg', '1700119858_banner_.jpg', '#', '0', 'pending'),
(21, 'Session on- Students learned the importance of Incubation Center in the Entrepreneurship Fortnight program under the Self-reliant India Campaign.', 'Physical', 'BTIRT COLLEGE SAGAR ', '2023-09-13 12:17:00', '2023-09-13 14:24:00', 101, 21, 2408, 'Entrepreneurship Fortnight program was organized under the Self-reliant India campaign today on 13 Sep 23 at BTIRT College Sagar. Kanhaiya Rakwar, Project Manager of Spark Incubation Center of Sagar Smart City and Startup Expert Shubham Dubey were invited as key speakers in this program.\r\nThrough this program, the students present learned how their own business can be established and what kind of assistance is provided to the startups from the Spark Incubation Center of Sagar Smart City to establish their own business. .\r\nThe students present in the program were told that if due to some reason you are not able to get a government or private job, then what option do you have to make your career or improve your financial condition?\r\nIt was told by the keynote speaker that if you have no other option then your own business or startup can prove to be a very good option in which incubation center can play a huge role in setting up your business. You just need a business idea. If your business idea is innovative and scalable then with the help of Spark Incubation you can convert this business idea into a successful business,\r\nTo make your business idea a successful business, Spark Incubation Center provides technical, non-technical, working space, mentor support and financial assistance, which is a completely free process.\r\nIn this program, Principal of BTIRT Mr. Phuskele ji, City President of Avpv, Professor Mr. Kamlesh Dubey, Sawan Singh and team from Government College Makronia, Avpv were present.\r\n\r\n', '#SPARK, #Awareness, #smartcitysagar', 'domestic', '1700124779.jpg', '1700124779_banner_.jpg', '#', '0', 'pending'),
(22, 'The process of making KRA of registered startup started through Spark Incubation Center.', 'Physical', 'SPARK incubation center sagar', '2023-09-06 12:57:00', '2023-09-15 16:58:00', 101, 21, 2408, 'From 6sep.to 15 sep. 2023 The process of making KRA of registered startup started through Spark Incubation Center by spark team.', '#sparkincubation, #startups #KRA', 'domestic', '1700134525.jpg', '1700134525_banner_.jpg', '#', '0', 'pending'),
(23, 'Celebrate Engineer\'s Day15/9/23', 'Physical', 'Infinity college sagar.', '2023-09-15 11:07:00', '2023-09-15 17:07:00', 101, 21, 2408, 'On the occasion of Engineer\'s Day, a program was organized at Infinity Management and Engineering College, in which Project Manager Kanhaiya Raikwar and Startup Expert Shubham Dubey from the team of Spark Incubation run by Sagar Smart City Limited were invited as keynote speakers.\r\nThe main objective of this program was to organize a seminar on how the innovations and inventions being made by engineering students in various fields can be turned into successful businesses.\r\nIt was told in this program that the ability and skills of Indian engineers are praised all over the world and this is the reason why Indian engineers are in highest demand in other countries besides India, and this is also an irony that Indian engineers are in great demand for their Instead of working in the country, they go and settle in other countries, the main reason for which is foreign jobs and good pay scale.\r\nBut in the present circumstances our country is changing, the youth is changing and their thinking is changing. Now today\'s youth wants to work for their country after getting educated, but due to lack of proper guidance, they had to face difficulties in doing some business of their own.\r\nToday, due to policies like Self-reliant India, our youth are able to do their own business by getting various types of facilities and guidance.\r\nThe main objective of the Spark Incubation Center run by Sagar Smart City is to empower the youth to start their own business and strengthen them financially so that they become job providers.\r\nFor this, Spark Incubation Center is making every possible effort to promote the startup ecosystem so that the youth of the area can arrange technical, non-technical support, mentorship, co-working space and funding etc. for their business so that they can start their own business. Become self-reliant and create employment.\r\n\r\nAll the students present in this program learned that even in a small town like Sagar, facilities like incubation can be easily available. For this, you just have to come up with an innovative and scalable business idea and on the basis of this business idea, the work of making you a successful business will be done by Spark Incubation Centre.\r\nAt the conclusion of the program, the principal of the college presented a sapling to the guests, which in itself is a commendable act. All the teachers and staff of the college were present in this program.\r\n', '#sparkincubation, #startup #Engineer\'sday', 'global', '1700135113.jpg', '1700135113_banner_.jpg', '#', '0', 'pending'),
(24, 'Session on  \" how you can make your business idea a successful business.\"', 'Physical', '  Gyan Sagar Engineering College sagar', '2023-09-18 11:18:00', '2023-09-18 15:18:00', 101, 21, 2408, 'On 18 September 2023, students of Gyan Sagar Engineering College learned how you can make your business idea a successful business.\r\nUnder the Self-reliant India campaign, a boot camp was organized at Gyan Sagar Engineering College in which Spark Incubation was invited as the keynote speaker. Startup expert Mr. Shubham Dubey and Startup Consultant Mr. Rahul Pathak from Spark Incubation were present.\r\nIn this program, Mr. Shubham Dubey of Spark Incubation gave information to the students about startup and incubation and told how the solution to a problem can be converted into a good business and how we can eliminate unemployment and financial crunch through it. Can\r\nThe facilities provided by incubation were also explained and how you can take your business idea forward was also discussed.\r\nIn this program, Principal of Gyan Sagar Engineering College Mr. Rajendra Jain and Assistant Professor Mr. Kamlesh Dubey from Government College Makronia, Sagar\'s social worker Mr. Kapil Malaiya and members of All India Student Council were present, and teachers and students were present.\r\n', '#sparkincubation #startup #bussinessidea', 'global', '1700135620.jpg', '1700135620_banner_.jpg', '#', '0', 'pending'),
(25, 'KRA SETTING OF STARTUP\'S.', 'Physical', 'SPARK incubation center sagar', '2023-09-16 15:25:00', '2023-09-22 17:25:00', 101, 21, 2408, 'From 16 sep. to 22 sep. 2023, The process of making KRA of registered startup started through Spark Incubation Center By spark team.', '#sparkincubation #smartcitysagar #startup', 'domestic', '1700136017.jpg', '1700136017_banner_.jpg', '#', '0', 'pending');
