(6, 'website developer', 'certified_internship', '203', 'Spark', '4', 'website developer', '0', 'We are looking for a talented and versatile Web Developer to join our team. The ideal candidate will be responsible for WordPress development, covering both frontend and backend tasks. In addition to technical skills, the candidate should have proficiency in graphic designing to contribute to the aesthetic appeal of our websites. This role requires a creative and detail-oriented individual with a passion for creating visually stunning and user-friendly online experiences.', 'Key Responsibilities:\r\n\r\nWordPress Development:\r\n\r\nCustomize and maintain WordPress themes and plugins to meet project requirements.\r\nDevelop responsive and visually appealing websites that align with the company\'s brand.\r\nFull Stack Development:\r\n\r\nImplement frontend solutions using HTML, CSS, and JavaScript, ensuring seamless user interactions.\r\nWork on backend tasks, including server-side scripting, database management, and API integrations.\r\nGraphic Designing:\r\n\r\nCreate visually compelling website layouts that enhance user experience.\r\nDesign custom graphics, icons, and other visual elements to maintain a cohesive and attractive online presence.\r\nDatabase Management:\r\n\r\nManage and optimize databases to ensure efficient data storage and retrieval.\r\nImplement data security measures and conduct regular backups to safeguard information.\r\nCollaboration and Communication:\r\n\r\nCollaborate with cross-functional teams, including designers, marketers, and content creators, to bring projects to fruition.\r\nCommunicate effectively with team members to understand project requirements and timelines.', 1, 'pending', 1, '2024-01-08 06:46:53', 'Proven experience as a Web Developer with a strong focus on WordPress development. Proficiency in fr', 'WordPress Proficiency', 'Full Stack Development Skills', 'Graphic Designing', 'Database Management', 'Problem-Solving and Collaboration'),
(7, 'Graphic Designer intern', 'certified_internship', '157', 'WFH', '1', 'Intern', '0', 'Designing Creative using Canva', 'We\'re looking for a Graphic Design Intern to join our startup crew. Your main job is to make eye-catching graphics that match our style using Canva. You\'ll also be in charge of our social media pages, making sure they look good and stay on track. Keep an eye on the latest trends on social media, and use your creativity to make cool and popular posts. Work closely with our marketing team to make visuals that fit our brand strategy. If you\'re full of ideas and excited about making things look great, we\'d love to have you on our team for this exciting journey.', 1, 'pending', 1, '2024-01-08 07:16:17', '12+, BA, BSc, B.Com, B.tech or any relevant stream', 'Canva', 'Figma', 'Video Editing ', NULL, NULL),
(8, 'Market Research Intern', 'certified_internship', '157', 'Spark', '1', 'Market Research Intern', '0', 'As a Market Research Intern at our startup, you\'ll focus on surveying the local electrical market, gathering feedback from sellers, and analyzing competitor products online. Contribute valuable insights to shape our market strategy and play a key role in our startup\'s success.', 'Are you ready to dive into the world of market research? Join our startup team as a Market Research Intern, where you\'ll play a vital role in understanding our local electrical market. Your main tasks will involve conducting surveys in the local market, focusing on the specific needs of our product. Engage with local sellers to gather valuable feedback and identify potential opportunities. Additionally, explore online platforms like Amazon and Flipkart to analyze product performance and reviews of our competitors. Your insights will be crucial in helping us navigate and succeed in the local and online markets. If you\'re curious, detail-oriented, and ready to explore the dynamics of our market, we invite you to be part of our startup adventure.', 1, 'pending', 1, '2024-01-08 07:34:19', '12+, BA, B.Sc, B.Com, B.Tech or any other stream (B.com & B.tech Preferred)', 'Communication (Hindi & Regional Languages)', 'MS Word & Excel ', 'Data Analytical skills', 'Team Work ', 'Market Awareness'),
(9, 'PCB Designer Intern', 'certified_internship', '157', 'WFH', '1', 'Intern', '0', 'Designing PCBs using EASYEDA, Altium designer, Proteus or any cad software.', 'Join Eviltron as a PCB Designer Intern and become a vital part of our product development team. Your primary responsibility will be designing printed circuit boards (PCBs) for our products. We\'re looking for someone with a basic understanding of electronics components such as resistors, transistors, and capacitors. Knowledge of PCB design concepts and familiarity with software like EASYEDA and Proteus is essential. If you\'re passionate about electronics and eager to apply your skills in a hands-on environment, this internship is the perfect opportunity to contribute to our innovative projects.', 1, 'pending', 1, '2024-01-08 07:45:31', 'B.tech (Ongoing or Completed)', 'PCB Designing', 'Basic Electronics', NULL, NULL, NULL),
(10, 'digital marketing ', 'certified_internship', '113', 'Spark', '1', 'digital marketing ', '0', 'work for digital marketing ', 'for digital marketing in construction field ', 1, 'pending', 1, '2024-01-11 08:53:28', 'BE , B.tech , BCA ,DCA, PGDCA', 'ms office', 'canva', 'video editing ', NULL, NULL),
(11, 'Billing Work', 'certified_internship', '113', 'Spark', '1', 'Billing & Accounting', '0', 'construction billing work', 'construction billing work', 1, 'pending', 1, '2024-01-11 08:55:53', 'BE & B.tech Civil Engineering', 'billing', 'ms office', 'autocad', '3dxmax', 'leveling work'),
(12, 'Sells and Marketing', 'Internship', '5630', 'Spark', '4', 'Sales and marketing interns', '6018', '2 male and 2 female marketing interns are required who can fulfill the sells and marketing requirements.', 'This is the target-based job in which intern will complete the sells targets. They will also receive some other allowance like travelling and other. ', 1, 'pending', 1, '2024-01-19 05:48:57', 'Graduate/Undergraduate', 'Sells work', 'Marketing work', 'Online work', NULL, NULL),
(13, 'Sells and Marketing', 'Full_Time', '17180', 'Spark', '02', 'Sales and marketing interns', '6018', 'Sells and marketing interns are required.', 'Sells and marketing interns are required.', 1, 'pending', 1, '2024-01-19 05:54:15', 'Graduate/Undergraduate', 'Sells work', 'Marketing work', 'Online work', NULL, NULL),
(14, 'Marketing', 'Full_Time', '17173', 'Spark', '01', 'Marketing interns', '5117', '1 marketing intern is required for marketing purpose.', 'Marketing intern will manage all types of online and offline marketing campaigns and also he/she will manage office work as per requirement.', 1, 'pending', 1, '2024-01-20 09:31:51', 'Graduate/Undergraduate', 'Marketing', 'Online work', NULL, NULL, NULL),
