INSERT INTO `scheme` (`id`, `title`, `description`, `document`, `created_datetitme`, `delstatus`) VALUES
(1, 'Spark Incubation center Policy', 'An incubation center policy provides a structured framework for nurturing and accelerating the growth of startups by offering resources, mentorship, and a collaborative environment. It aims to foster innovation, entrepreneurship, and sustainable business development through targeted support and networking opportunities.', '1691565834.pdf', '2023-08-09 07:23:53', 1),
(2, 'Startup India Seed Fund Scheme ', 'The Startup India Seed Fund Scheme offers financial support to early-stage startups for activities such as proof of concept, prototype development, and product commercialization. The scheme may include grants, equity investments, or convertible notes to provide the necessary funding for innovative projects.', '1691566142.pdf', '2023-08-09 07:29:02', 1),
(3, 'Startup Madhya Pradesh Policy', 'The Startup Madhya Pradesh policy is a government initiative aimed at fostering a vibrant ecosystem for startups in the state. It offers incentives such as financial aid, tax benefits, and infrastructure support, while also focusing on skill development, incubation centers, and innovation hubs to nurture entrepreneurship and drive economic growth.', '1691566243.pdf', '2023-08-09 07:30:43', 1),
(4, 'DPIIT Recognition ', 'The DPIIT guidelines outline the eligibility criteria, application process, and privileges associated with the recognition, streamlining support for startups and encouraging entrepreneurial endeavors.', '1691566392.pdf', '2023-08-09 07:33:12', 1),
(5, 'Startup India Scheme ', 'The Startup India scheme is an Indian government program focused on fostering entrepreneurship and innovation, offering startups benefits like tax breaks, simplified regulations, access to funding, and mentorship support, all aimed at accelerating their growth and success.', '1691566876.pdf', '2023-08-09 07:41:16', 1),
(6, 'Mudra Loan Scheme', 'The MUDRA Loan Scheme is a financial initiative by the Indian government that provides financial support to micro and small enterprises, enabling them to access credit for business expansion and development. This scheme offers three categories of loans – Shishu, Kishore, and Tarun – catering to different stages of business growth, making financing more accessible to entrepreneurs and promoting economic inclusivity.', '1691567658.pdf', '2023-08-09 07:54:17', 1),
(7, 'MSME Innovative Scheme', 'The MSME Innovative Scheme is designed to encourage innovation in Micro, Small, and Medium Enterprises (MSMEs) by providing financial support for research, development, and technology adoption. This scheme offers funding for innovation projects, product development, technology upgradation, and market expansion, enhancing the competitiveness and growth potential of MSMEs in various industries.', '1691567784.pdf', '2023-08-09 07:56:23', 1),
(8, 'Coir Udyami Yojana', 'Coir Udyami Yojana is an Indian government initiative aimed at promoting entrepreneurship in the coir sector. This scheme offers financial assistance, training, and market linkages to individuals or groups seeking to establish coir-based enterprises, fostering sustainable economic development and employment opportunities.', '1691567921.pdf', '2023-08-09 07:58:40', 1),
(9, 'Credit Guarantee Fund Scheme For Micro And Small Enterprise', 'The Credit Guarantee Fund Scheme for Micro and Small Enterprises (CGS-MSE) provides collateral-free credit facilities to eligible enterprises, ensuring easier access to finance. This scheme guarantees a significant portion of loans extended to MSEs, reducing the risk for lenders and enabling small businesses to secure funding for expansion, modernization, or working capital needs.', '1691568108.pdf', '2023-08-09 08:01:48', 1),
(10, 'National Initiative for Developing and Harnessing Innovations (NIDHI)', 'The National Initiative for Developing and Harnessing Innovations (NIDHI) aims to nurture innovation and startups in India. This initiative offers various programs, including grants, seed funds, incubation support, and mentoring, fostering a culture of entrepreneurship and driving innovative solutions across different sectors.', '1691568233.pdf', '2023-08-09 08:03:52', 1);
