INSERT INTO `services` (`id`, `service_name`, `service_description`, `service_img`, `status`) VALUES
(1, 'adad', '<p>asdad</p>', '1669964149.png', 0),
(2, 'adad', '<p>asdad</p>', '1669964118.png', 0),
(3, 'Website Creation', '<p>Website is an important tool where you can present all the required information about your business. You can get your website created from any IT professional, in case you need any help in getting this done from Incubation centre, then follow the steps to avail this service:</p><p><strong>Step 1:</strong> Create the document file with following information&nbsp;</p><ul><li>Do you have a domain name? If yes then mention the name of your domain.</li><li>INCUBATION CENTRE will helps you to create static website only – How many pages do you need?</li><li>Write content for each page.</li><li>Attach - <strong>Logo</strong></li><li>Social Media Handle Link (Facebook, Twitter, LinkedIn, Instagram etc.)</li><li>Attach some images which needed for website.</li><li>Contact Details ( Office address, Phone No/Mobile No / Email ID )</li></ul><p><strong>Step 2:</strong> After completing the document send an email at&nbsp;<a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a> and also submit request click on below button.</p><p>Please note that we will only help you in creating a simple website for your business where hosting and domain will have to be procured by you at your cost. If you wish you get a more detailed website, you can still write it to us we will connect you to professional IT service providers. Any financials about the development will be between startup and the developers, INCUBATION CENTRE will not be responsible for that and can’t be held accountable for anything.</p>', '1669964196.png', 1),
(4, 'App Development', '<p>Mobile application helps to customer to access service or product of any business. If you need mobile application please follow the below steps-</p><p><strong>Step 1:</strong> Create the document file with following information –</p><ul><li>Which types of application you need – Static or Dynamic?</li><li>What functionality or feature need in that application?&nbsp;</li><li>In which OS your app should work – iOS or Android?</li><li>Mentioned the Name or link: if any reference mobile app available in play store.</li></ul><p><strong>Step 2:</strong> After completing the document send email at&nbsp;<a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a> and also submit request click on below button.</p><p>Team INCUBATION CENTRE then forward this information to the professional Mobile App Developers. Any financials about the development will be between startup and the developers, INCUBATION CENTRE will not be responsible for that and can’t be held accountable for anything.&nbsp;</p>', '1669964210.png', 1),
(5, 'Social Media Presence', '<p>If you promote your product and services on digital platforms like Facebook, twitter, LinkedIn, Instagram, YouTube then your business will be able reach more target audience.</p><p>If you required training program for social media presence then follow the steps:</p><p><strong>Step 1:</strong> Create the document file with following question</p><ul><li>Do you have social media pages? If you have please mentioned that links.</li><li>What time you preferred for training session?</li><li>Any specific topic which you want to learn.</li></ul><p><strong>Step 2:</strong> After completing the document send email at&nbsp;<a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a> and also submit request click on below button.</p><p>If you wish you to on-board a professional agency to handle your social media and internet presence, you can write it to us we will connect you to professional Digital Marketing service providers. Any financials about the development will be between startup and the developers, INCUBATION CENTRE will not be responsible for that and can’t be held accountable for anything.</p>', '1669964223.png', 1),
(6, 'Brochure Design', '<p>Every business required brochure to present their services and products.&nbsp;<br>If you want to design brochure for your startup please follow the below steps -</p><p><strong>Step 1:</strong> Create the document file with following question</p><ul><li>Purpose for designing brochure.</li><li>How many pages in that brochure – (MAX-4).</li><li>Provide the full content details.</li><li>Attached the images which you like to place init.</li></ul><p><strong>Step 2:</strong> After completing the document send email at&nbsp;<a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a> and also submit request click on below button.</p><p>&nbsp;</p><p>If you wish you to on-board a professional agency to handle your brochures and creatives, you can write it to us we will connect you to professional Digital Marketing service providers. Any financials about the development will be between startup and the developers, INCUBATION CENTRE will not be responsible for that and can’t be held accountable for anything.</p>', '1669964234.png', 1),
(7, 'Video Creation', '<p>If you want to create video for your services and product. Please follow the steps to avail this service.&nbsp;</p><p><strong>Step 1:</strong> Create the PPT for the video (attach all content – text, images)&nbsp;<br><strong>Step 2:</strong> Video Size will be MAX: 2 min&nbsp;<br><strong>Step 3:</strong> Send your PPT at&nbsp;<a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a> and also submit request click on below button.</p><p>&nbsp;</p><p>If you wish you to on-board a professional agency to create professional videos, you can write it to us we will connect you to professional Video Creation service providers. Any financials about the development will be between startup and the developers, INCUBATION CENTRE will not be responsible for that and can’t be held accountable for anything.</p>', '1669964247.png', 1),
(8, 'Need Business ERP', '<p>ERP -Enterprise Resource Planning is the web application which handle the operation of company. INCUBATION CENTRE can help you get a free of cost and easy to use Startup ERP from the market.&nbsp;</p><p>To avail this service follow the steps:</p><p><strong>Step 1:</strong> Create a request document with following information:</p><ul><li>How many employee do you have?</li><li>What operation do you handle with this ERP?</li><li>Do you have any existing ERP software?&nbsp;</li><li>How many modules you want to use in the ERP such as Finance, HR, Payroll, Project Management etc.&nbsp;<br><br>&nbsp;</li></ul><p><strong>Step 2:</strong> Send your document at&nbsp;<a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a> and also submit request click on below button.</p>', '1669964263.png', 1),
(9, 'MVP Creation', '<p>A minimum viable product, or MVP, is a product with enough features to attract early-adopter customers and validate a product idea.</p><p>To avail this service follow the steps:</p><p><strong>Step 1:</strong> Create a request document with following information:</p><ul><li>Which type of prototype you want to attract early-adopter customers.</li></ul><p>(Example – Video, Brochure, Website, App, Wireframe, UI/UX, Presentation etc.)</p><ul><li>Mentioned all necessary details in the document.</li></ul><p>&nbsp;</p><p><strong>Step 2:</strong> Send your document at&nbsp;<a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a> and also submit request click on below button.</p><p>Once we receive the information, we will organize a session with your team with MVP experts to guide you further in creating your MVP.</p>', '1669964277.png', 1),
(10, 'Internet Services', '<p>If you are a physical or resident startup of Incubation Centre then internet service is directly provided to you on the premise.&nbsp;</p><p>In case you are not happy with the speed of the internet offered at the incubation centre you can write it to <a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a></p>', '1669964553.png', 1),
(11, 'IPR / Patent', '<p>IP stands for Intellectual Property, whereas IPR stands for Intellectual Property Rights. The term IP is used in reference to original, novel creations and inventions which differentiate or set a business apart from another. Creators should get the exclusive monopoly and commercial benefits for their IPs. These rights are afforded to inventors and creators under the umbrella of intellectual property rights.&nbsp;</p><p>&nbsp;</p><p>Broadly speaking, IPR is a vast domain that covers a variety of inventions and creations. There are laws in place that can protect your innovative inventions, processes designs, and literary works and so on. These laws are known as Intellectual Property Rights. IPRs are widely applied to all kinds of innovations and inventions, which include Trademarks, Copyrights, Trade Secrets and also Patents.</p><p>&nbsp;</p><p>What is a patent?</p><p>A patent is essentially an Intellectual property right which protects new inventions and non-obvious discoveries. When you invent something, you can file for a patent and get the exclusive rights to monopolise your invention. The Patent Office evaluates whether the invention is indeed new and grants you the Patent in approximately 2-3 years, after following a due process. The Patent is protected under an IPR law, which you can leverage to use your invention the way you deem fit – whether to set up a business or license the invention.</p><p>&nbsp;</p><p>Patent vs IPR – the key differences</p><p>So, what is the difference between Patent and IPR? Let’s break down the differences between the two.</p><p>&nbsp;</p><p>General vs standalone</p><p>IPR represents the general laws that protect all types of innovations and creations, be it new designs, literary works like novels, movies, songs, etc., as well as trademarks like brand logos. Trade secrets and processes are also protected under IPR, as are patents. A patent, however, is a document or legal certificate given for protecting a design, utility or innovation, which comes under the broad umbrella of IPRs.</p><p>&nbsp;</p><p>Categories and sub-categories</p><p>IPRs are further categorised into different types based on the fields and type of inventions or creations. The categories include trademarks, copyrights, trade secrets and also patents. Patents have their own sub-categories. Inventors can file patents for designs, utilities, and asexually reproduced plants. The utility patent is further categorised as patents for machines, manufacturers, compositions of matter and improvements to these categories. In India, one can only file for design patents. They can, however, apply for utility and plant patterns in several foreign countries.</p><p>&nbsp;</p><p>Filing and Applicability</p><p>Another point of difference between IPR and patents involves filing and applicability. Trademarks and copyrights are IPR laws which are typically universal in nature, which means they are automatically applicable across the world, and, creators do not have to register for these creations. Conversely, one has to file a patent application to get exclusive rights. Furthermore, the Patent only applies within the country in which it is filed, unlike other IPRs which are universally applicable. However, inventors may apply for international, country-specific patents as well.</p><p>&nbsp;</p><p>To apply for any Intellectual property rights:</p><p><i><strong>Drop email at&nbsp;</strong></i><a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a><i> and mentioned all the details for IPR <strong>and also click on below button</strong> to submit request.</i></p><p><i>Once we receive your request, we will connect you to IPR Experts to get our application move forward.&nbsp;</i></p>', '1669964608.png', 1),
(12, 'Startup Legal Services', '<p>Get the legal services for your startup with our mentors of experienced attorneys dedicated to helping you succeed. The journey from Start-up to the business giant is a hard and challenging battle. Most startups need to spend time focusing on idea development and distinguishing themselves from their competitors in the market. Finalizing the legal documents to bring these ideas to successful fruition, even though absolutely imperative and an advantage, often gets postponed. Legal help for Startups in their business formation and to cover statutory legal compliances results in laying a solid base and hassle-free operations which provides entrepreneurs/ founders/ promoters to focus on the more vital needs such as hiring, funding and finance and other processes to enable growth. Get your startup on the right track with our specialized startup legal services, tailored to meet your unique business needs.</p><p>To get this service follow the steps:&nbsp;</p><p><strong>Drop the email at</strong>&nbsp;<a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a></p><p>Please mentioned legal service name and details – Corporate Commercial, Transactional Advisory, IP, FDI, Employment &amp; HR, and Company Secretarial.</p><p>Once we receive your request, we will connect you to the legal experts.&nbsp;</p>', '1669964626.png', 1);
