(13, 'DPIIT Registration', '<p>To access tax benefits and easier compliance, companies have to be recognized as Startups by the Department for Promotion of Industry and Internal Trade (DPIIT) under the Startup India initiative. Startups recognized by DIPP can avail Intellectual property Rights (IPR) related benefits such as IPR fast-tracking and more without requiring any other license from the Inter-Ministerial Board. The current article provides a brief understanding of DPIIT Certificate of Recognition for Start-ups.</p><p>&nbsp;</p><p><strong>Eligibility Criteria</strong></p><p>The startup must meet the following eligibility criteria to avail the DPIIT Certificate of Recognition:</p><p>&nbsp;</p><ul><li><strong>Period of Existence of Entity:</strong> The Period of existence and operations of the company should not exceed 10 years from the date of formation</li><li><strong>Type of Entity:</strong> The DPIIT Certificate of Recognition is provided for the company which is incorporated as a Private Limited Company, a Limited Liability Partnership (LLP) or a Registered Partnership Firm.</li><li><strong>Annual Turnover:</strong> To get the DPIIT Certificate of Recognition, The firm should have an annual turnover &nbsp;not exceed &nbsp;more than Rs. 100 crore for any of the fiscal years since its federation</li><li><strong>Original Entity:</strong> To avail the DPIIT Certificate of Recognition, the company should not have been incorporated by splitting up or recreating an already existing entity.</li><li><strong>Innovative &amp; Scalable Entity:</strong> The entity should be working towards development or improvement of a product, process or service.</li></ul><p><strong>Documents Required</strong></p><p>The documents required for the DPIIT Certificate of Recognition for Startups is listed as follows:</p><p>&nbsp;</p><ul><li>Certificate of Incorporation or Registration of entity</li><li>If the startup received any funding, the Proof of Funding need to furnish for DPIIT Certificate of Recognition for Startups</li><li>Document of awards or recognition received by the entity</li><li>Document of the patent published by the entity (The patent should be published in the patent journals)</li><li>A brief description of the nature of the business. The write-up should contain the following details:<ul><li>Details of how the startup is working towards innovation</li><li>Development of products or processes or services</li><li>The scalability in terms of employment generation or wealth creation</li></ul></li></ul><p><strong>Applicable Fee</strong></p><p>The startups are not required to pay any fee to the Ministry of Commerce and Industry for obtaining the DPIIT Certificate of Recognition for Startups.</p><p>&nbsp;</p><p><strong>Application Procedure to get DPIIT Certificate of Recognition for Startup</strong>s</p><p>The entity should follow the below-mentioned simple steps to get the DPIIT certificate of recognition.</p><p>&nbsp;</p><p><strong>Apply for Start-up Recognition</strong></p><p>The applicant unit need access the&nbsp;<a href=\"https://www.startupindia.gov.in/content/sih/en/recognition-page.html\">Start-up India Recognition portal</a>&nbsp;for Register with Start-up India to get the DPIIT Certificate of Recognition for Startups.</p><p><img src=\"data:image/jpeg;base64,\" alt=\"Image 1 DPIIT Certificate of Recognition for Startups\"><br><br>&nbsp;</p><p>Provide the following details in the Start-up Recognition application:</p><ul><li>Entity Details: Nature of Entity, Industry, Sector, Categories and Company Incorporation Number and Registration Date</li><li>Full Address of the Entity</li><li>Details of the Authorized Representative</li><li>Directors or Partner Details</li><li>Details of Intellectual Property Right</li><li>Details of funding</li><li>Recognition received by the entity</li></ul><p>&nbsp;</p><p><img src=\"data:image/jpeg;base64,\" alt=\"Image 2 DPIIT Certificate of Recognition for Startups\"></p><p>&nbsp;</p><p>&nbsp;</p><p>After providing the information related to the entity, upload the required documents.</p><p><img src=\"data:image/jpeg;base64,\" alt=\"Image 3 DPIIT Certificate of Recognition for Startups\"></p><p>&nbsp;</p><h3>Get the Startup Recognition Number</h3><p>The DPIIT Certificate of Recognition for Start-ups will be issued after examination of the application and documents submitted.<br><br>Once the ministry approves the application and provides the unique startup recognition number, the startup can be registered with tax benefits.</p><p>If you need any help in the DPIIT application process, please send an email at&nbsp;<a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a></p>', '1669964639.png', 1);
