(14, 'Startup Valuation', '<p>Startup valuation is the process of calculating the value of a startup company. Startup valuation methods are particularly important because they are typically applied to startup companies that are currently at a pre-revenue stage.</p><p>&nbsp;</p><p>Please follow the steps to get valuation:</p><p>1. Find companies in the similar industry for comparison</p><p>2. How many times their valuation is bigger than revenue</p><p>3. Calculate the multiple from above</p><p>4. Multiple your revenue by the multiple</p><p>5. Take revenues this month, year, and next year</p><p>6. Calculate 3 cases (Best, Worst, and Base)</p><p>7. Triangulate the 3 cases</p><p>8. Project your startup exit</p><p>9. Discount earnings by money time value</p><p>10. Voila! Here’s your valuation!</p><p>&nbsp;</p><p>If you need experts to derive the valuation of your startup then please drop an email at&nbsp;<a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a>.&nbsp;</p>', '1669964650.png', 1),
(15, 'Startup Pitch Deck', '<p>A startup pitch deck — or investor pitch deck — is a brief presentation designed to showcase your business plan, eye-popping metrics, and vision for the company to raise capital from investors. Generally, early-stage startup pitch decks are between 10-20 slides long.</p><p>The first thing to take into consideration is the structure of the pitch.</p><ul><li>Problem/Opportunity</li><li>Solution/Product</li><li>Business Model</li><li>Market Size</li><li>Go-to-Market Strategy</li><li>Competition</li><li>Milestones</li><li>Ask/Funding Needs</li><li>Use of Funds</li><li>Economic Forecasts&nbsp;</li><li>Team</li></ul><p><i>Do you need template or expert advisory please drop email at&nbsp;</i><a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a></p>', '1669964799.png', 1),
(16, 'Hiring', '<h3><strong>What is Hiring:</strong></h3><p><strong>Hiring is the process of reviewing applications, selecting the right candidates to interview, performing various pre-employment tests and checks.</strong></p><h3><strong>Benefits of Hiring:</strong></h3><p><strong>Hiring in your startups can bring fresh perspectives, innovation, and creative ideas. &nbsp;That helps to grow your business With Diversify skills.</strong></p><h3><strong>How to Avail Hiring:</strong></h3><ul><li><strong>1) Click the below button to Apply.</strong></li><li><strong>2) Fill the Necessary Details.</strong></li></ul><p>&nbsp;</p><p><strong><img src=\"https://lh4.googleusercontent.com/l9WRAvgLs54lKxbBkO1YJfEJoNC4hBIA4bZ9yrtyA6w9-LQwWgyvi-uV8SWhYoRWdUu2GdWs1vLFuE8HTlDGXOhWY582czhP87qbXuOEFOF9nzy7N_xkWvIq9XN6RkOIZnrBmaymCj-2T3RyO0rZxzL1mYH5Z19rYtgOTi8wDSwC2TgPzfYd8anojVJwzQ\"></strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '1669964812.png', 0),
(17, 'AWS Credits', '<p>STEPS TO AVAIL AWS CREDITS</p><p>Amazon Web Services (AWS) provides startups with low cost, easy to use infrastructure needed to scale and grow any size business. AWS Activate is a program designed to provide startups with resources they need to get started on AWS. Join some of the fastest-growing startups in the world and build your business using AWS!</p><p>&nbsp;</p><p><strong>Instructions for Startups:&nbsp;</strong></p><p>Visit the AWS Activate webpage to apply using the following:</p><ul><li>URL: https://aws.amazon.com/activate/portfolio-signup</li><li>The validity of the credits will be starting with the funding/investment/incubation date so do apply at the earliest</li><li>Be sure to provide your AWS Account ID when you apply. Promotional Credits will be added to the account number you submit with this application.</li><li>Please sign up using your company e-mail address.</li></ul><p>&nbsp;</p><p>Start-ups will be eligible for:</p><p><strong>AWS Credits:</strong></p><p>$2,000 to $5,000 in AWS Promotional Credits valid for 1 years that can be used for a wide variety of 70+ services in including Compute, Storage, Databases, Analytics, IoT, Artificial Intelligence, Content Delivery, Messaging and others.</p><p><strong>Organization ID* (case-sensitive): 0ui8b</strong></p>', '1669970962.png', 1),
(18, 'Connect with Mentor', '<p>Connect with Mentor</p>', '1669970972.png', 0),
(19, 'Business Model', '<p>If you want to create business model for your startup. Our expert will helps you.</p><p>To connect with the mentor raise the meeting request with mentor this option is enabled in your panel. In case if your facing any problem to schedule meeting just drop email at <a href=\"mailto:connect@jicjabalpur.org\">connect@sagarstartuppark.org</a> and also submit the request form by clicking on below button.</p>', '1669970981.png', 1),
(20, 'Conference Booking', '<p>Conference Booking</p>', '1669970995.png', 0),
(21, 'MSG 91 Credits', '<p>MSG91 is a cloud communication platform that offers powerful messaging solutions to empower business communications. It consists of 10+ channels across the platform offering services over SMS, Email, Voice, WhatsApp, RCS (Rich Communications Services) via API (Application Programming Interface)</p><p><strong>Benefits Provided by Msg91</strong>&nbsp;</p><ul><li>MSG91 shall add credits worth INR 6250 per month for a period of 6 months (For transactional SMS &amp; OTP) as per the MSG91 Startup Policy.</li><li>MSG91 will offer 20000 Transactional Emails complimentary to the startup.</li><li>MSG91 shall provide a Process doc, Email and Source Link with Start-ups.</li><li>MSG91 shall provide both technical and non-technical assistance.</li></ul><p><strong>Here is the process to access the offer of Msg91</strong></p><ul><li>Signup using http://control.msg91.com/signup/?source=SAGAR</li><li>Generate Authkey from the dashboard.</li><li>Integrate the MSG91 API via Socket (monthly offer credits only to be given after API integration)</li><li>And then fill-up the form at&nbsp;<a href=\"https://msg91.com/startups/\">https://msg91.com/startups/</a> &nbsp;using the coupon code.</li></ul><p><strong>Terms and conditions:</strong></p><ul><li>Startup needs to sign-up with official email id only (Private domain).</li><li>It can only be approved once we get the approval from the concerned person of the accelerator program.</li></ul>', '1669971007.png', 1),
(22, 'Startup KRA', '<p>Startup KRA</p>', '1669971021.png', 0),
(23, 'ComeChat', '<p><strong>CometChat’s in-app communication platform delivers a scalable, secure, and easy-to-use solution that drives meaningful user-to-user engagement for your growing business.&nbsp;</strong></p><h4><strong>Benefits of Come T Chat</strong></h4><ul><li><strong>Free Credits- $5000 credits – valid for 3 months.</strong></li><li><strong>Learning and Development: Exclusive sessions that may include sharing of knowledge and lessons learned, organizational development and sustainability, growth, and new initiatives.</strong></li><li><strong>Mentoring- Mentoring sessions by&nbsp; Co-Founders based on availability.</strong></li><li><strong>On-demand Training &amp; Support- It will give you access to Product &amp; Engineering Team in the form of a prioritized channel for technical support and on-demand training as required.</strong></li></ul><h4><strong>How to Apply:</strong><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSenVhVrdXkFNIgIOAIc0ZDg0nUD0xA61gU2HVV78D0OJ-BD2Q/viewform\"><strong>&nbsp;https://docs.google.com/forms/d/e/1FAIpQLSenVhVrdXkFNIgIOAIc0ZDg0nUD0xA61gU2HVV78D0OJ-BD2Q/viewform</strong></a></h4>', '1670581949.png', 1),
(24, 'Vidphone', '<p><strong>Vidphone is an End-to-end video engagement platform enabling startups to grow their business and build their community.&nbsp;Vidphone offer everything from Virtual Offices, Video Meetings, Webinars and Video Mail. Their SDK enables to create powerful and flexible applications with live video at it’s core.</strong></p><p><strong>Vidhphone&nbsp; offer a 20% discount on our monthly plans and 30% discount on our yearly plans for your incubated startups.</strong></p><h4><strong>Apply Now: https://vidphone.me/pricing/meeting&nbsp;</strong></h4><h4><strong>Vidphone Services :</strong></h4><ul><li><strong>Drive Traffic/Grow your brand – It enable startups to drive traffic to their website/campaigns, promos etc via webinar series.</strong></li><li><strong>Nurture leads - Nurture leads obtained from your webinars by sending them video mails or adding them to our video marketing automation.</strong></li><li><strong>Increase sales - Schedule meetings easily with nurtured leads. Unleash your sales agents to convert the sale on high quality video meetings. Integrate the video widget and convert website visitors into sales.</strong></li><li><strong>Internal collaboration - Collaborate with your team from anywhere with personal permanent meeting rooms and your own virtual HQ.</strong></li></ul>', '1670582008.png', 0),
(25, 'T nine', '<p><strong>T nine is the one-stop solution to all your tech-based problems. With an amalgamation of designers, developers, and content creators, Tnine Infotech aims to provide you with the best services to elevate your businesses, in a hassle-free way.&nbsp;</strong></p><p><strong>Benefit:&nbsp; Startups will get 100k worth of credits</strong></p>', '1670582052.png', 0),
(26, 'Razorpay', '<p><strong>Razorpay is India’s first full-stack financial solutions company. The Razorpay Product Suite today comprises verticals, along with Payment Gateway, like Payment Links, Payment Pages, Subscriptions, Smart Collect, Route, Razorpay Capital, RazorpayX, Payroll and Thirdwatch.&nbsp;</strong></p><p><strong>Benefits:</strong></p><ul><li><strong>All new sub-merchants referred will be eligible for INR 3,00,000 free credits on Razorpay payments products (Payment Gateway, Payment Pages, Payment Links, Payment Buttons, etc).</strong></li><li><strong>These free credits will get consumed as and when the merchant makes transactions by Razorpay.</strong></li><li><strong>For the time this offer is valid, there will be no fees charged for transactions by Razorpay until the Free Credits amount has been exhausted and expire on from 3 months of signup.</strong></li></ul>', '1670582113.png', 0),
(27, 'SketchNote', '<p><strong>Sketchnote provide customizable templates, recommended lessons and markdown editors that can be used for everything from daily scribbles to creating precise documents, and manage your team - all in one place !</strong></p><p><strong>Benefits :</strong></p><p><strong>The incubated startups will get 3 Months free access to Sketchnote dashboard</strong></p>', '1670582150.png', 0),
(28, 'Exotel', '<p><strong>Exotel is a cloud telephony platform that powers communication for enterprises, startups and small and medium enterprises in India and Southeast Asia.&nbsp;</strong></p><p><strong>Benefits :</strong></p><ul><li><strong>Free benefits of up to ₹15,000 for Exotel\'s full-stack communication suite.</strong></li><li><strong>Startups can use them for&nbsp; CAN USE THEM FOR</strong></li><li><strong>Voice</strong></li><li><strong>Smart SMS</strong></li><li><strong>Authentication</strong></li><li><strong>Access our rich startup resources library</strong></li><li><strong>Learn and grow with help of industry experts</strong></li></ul><p><strong>Join the vast Exotel Startup community for connecting and co-marketing opportunities</strong></p>', '1670582203.png', 0),
(29, 'Callerdesk', '<p><strong>Caller desk is a cloud voice communication platform which helps Businesses to setup cloud IVR &amp; Virtual Call centre all over India for enabling their staff to work remotely. It uses to track all incoming/outgoing calls of employees, let your team add notes, track follow-up actions &amp; customer feedback.</strong></p><h4><strong>Benefits</strong></h4><p><strong>Callerdeck will provide&nbsp; Cloud IVR Subscription premium package as Freebie offering to the registered startups of Satna.</strong></p><p><strong>• Product: DeskTalk ( Cloud Remote working Solution )</strong></p><p><strong>• Validity = 6 Months</strong></p><p><strong>• 16,000 total Inbound calling minutes ( Worth Rupee 16K INR )</strong></p><p><strong>• Unlimited Departments</strong></p><p><strong>• Unlimited users</strong></p><p><strong>• 1 Desk Phone ( DID) Free with this plan</strong></p><p><strong>• Security enabled- OTP based, enabled IP Restrictions feature, panel activity history</strong></p><p><strong>• Ready made IVR Journey for missed call routing, Direct routing, welcome sound or DTMF Routing</strong></p><p><strong>• 4 Different languages selection</strong></p><p><strong>• Office work time/day time-Schedule</strong></p><p><strong>• Customized Voicemail &amp; pre-greetings sound clip</strong></p><p><strong>• Multiple login access</strong></p><p><strong>• 50+ Other Features</strong></p><h4><strong>&nbsp;Process flow</strong></h4><ol><li><strong>Registered Startups need to open&nbsp; shared link for registration.</strong></li><li><strong>Fill up all the required details in the form link - https://forms.gle/fzzcmFW3CMKpjj5R9</strong></li><li><strong>CallerDesk team will connect with applied startup based on provided contact details to create callerdesk platform account within 24 to 48 hours.</strong></li><li><strong>A dedicated Account/ Product manager will be aligned for customer on-boarding and product training.</strong></li><li><strong>Initially the account validity will be 15 days, as the customer needs to provide all the necessary KYC documents as per the government regulation specifically TRAI/Department of communication. This will act as a deterrent to any spamming activities.</strong></li><li><strong>After KYC verification, the account will be activated for 6 months along with Startups .</strong></li><li><strong>After 6 months of validity or post consumption of freebies offered minutes, one customized plan can be configured to continue CallerDesk services along with a 10% discount on every standard platform subscription .</strong></li></ol>', '1670582264.png', 1),
(30, 'Effitrac', '<p><strong>Effitrac has been engineered to aid the businesses to stay ahead of the competition and to reinvent the way they work. Effitrac is currently offering 27+ modules across financial accounting, sales, purchase, hr, payroll, CRM, project management, process &amp; discrete manufacturing for various industries.&nbsp;</strong></p><h4><strong>What Effitrac offers:</strong></h4><p><strong>· &nbsp; &nbsp; &nbsp; Family Offices</strong></p><p><strong>· &nbsp; &nbsp; &nbsp; EPC</strong></p><p><strong>· &nbsp; &nbsp; &nbsp; Staffing</strong></p><p><strong>· &nbsp; &nbsp; &nbsp; Money Exchange &amp; Remittance</strong></p><p><strong>· &nbsp; &nbsp; &nbsp; Wholesalers and Distributor sectors.</strong></p><p><strong>· &nbsp; &nbsp; &nbsp; Industrial Machinery and Products</strong></p><p><strong>· &nbsp; &nbsp; &nbsp; Auto Components</strong></p><p><strong>· &nbsp; &nbsp; &nbsp; Textiles</strong></p><p><strong>· &nbsp; &nbsp; &nbsp; Home Textiles</strong></p><p><strong>· &nbsp; &nbsp; &nbsp; Wholesalers</strong></p><p><strong>· &nbsp; &nbsp; &nbsp; Distributors</strong></p><p><strong>· &nbsp; &nbsp; &nbsp; Leather</strong></p><h4><strong>Benefits :</strong></h4><p><strong>1 lakh worth of free credits for women entrepreneurs to empower them in managing their business effectively</strong></p>', '1670582441.png', 0),
