(47, 'TatkalWeb.com', 'FPO PROFILE\r\n\r\nFoodgod Farmer Produce Company Limited (FPC)\r\nThe only GoI recognized Startup FPO in India!\r\n\r\nLegal Entity:\r\nFoodgod Farmer Produce Company Limited (FPC) is a recognized Startup by the Government of India (Reg No. DIPP105083). Incorporated on the 18th of August, 2021 under the Companies Act, 2013 (18 of 2013), Foodgod is a private limited company, operating with the highest degree of financial integrity and commitment to the growth and prosperity of Indian farmers. \r\n\r\nCIN No: U01100MP2021PTC057164\r\nPAN No: AAECF6899H\r\nTAN No: BPLF01034F\r\nGST No: 23AAECF6899H1Z8\r\n\r\nCommunity Impact:\r\nFoodgod has successfully mobilized a total of 415 farmers, reaching across various social categories and communities. This includes 200 small farmers, 200 marginal farmers, 100 female farmers, 50 aboriginal farmers, and a significant representation from the SC/ST (35) and OBC (275) farmer communities. The company\'s operations extend to 10 Gram Panchayats and 25 villages, indicating a considerable reach and influence in the rural agricultural sectors. \r\n\r\nLicenses and Certifications:\r\nFoodgod FPC holds several critical licenses and certifications that validate its operations and practices, including:\r\n\r\n- Startup India Recognized Certificate No.: DIPP105083\r\n- DGCA certified Remote Pilot License No.: Certificate No. PC122200001MP\r\n- Importer-Exporter Code (IEC): AAECF6899H\r\n- APEDA Registration No.: 220767\r\n- Pesticide license No.: RS/427/1427/43/2022\r\n- Fertilizer license No.: RS/427/1401/42/2022\r\n- Seed license for vegetable Licence No.: RS/427/6603/2/2022\r\n- Seed license for crop Licence No.: RS/427/1403/19/2022\r\n- MSME License: UDYAM-MP-39-0009036\r\n- eNAM Portal Membership\r\n- NAFPO membership\r\n\r\nFoodgod is also currently working on obtaining the DGCA Type Certificate, RPTO Registration, and IP – Patent & Trademark Registration. \r\n\r\nAchievements and Milestones:\r\nFoodgod has had significant successes since its inception:\r\n\r\n1. Being recognized as the First Startup FPO in India by the Government of India.\r\n2. The company gained recognition for its innovative use of technology in agriculture, achieving a 1st runner-up position at the esteemed Bundelkhand Spark Hackathon 2.0 for precision farming using smart agriculture kisan drones.\r\n3. Foodgod has manufactured a smart agriculture spraying kisan drone and conducted demonstrations for farmers and Krishi Vigyan Kendras (KVKs).\r\n4. The company has already sprayed over 450+ hectares and served 400+ farmers in 8 KVKs (Bijora, Sagar, Damoh, Harda, Seoni, Shahdol, Panna, Dindori).\r\n\r\nTo get a more vivid glimpse of Foodgod\'s activities and impact, you can view this album: [Foodgod Activities] https://photos.app.goo.gl/y65YBej5uX4TVrod7', '', 'Early_Revenues', NULL, NULL, NULL, '9850820909', 'RMANISH2000@YAHOO.CO.IN', '2d7f089ca2518c7af08882cec732f798', '**Smart Agriculture Drone Manufacturing and Spraying Services**\r\n\r\n1. Product: Smart Agriculture Drones\r\n\r\n**1.1. Precision Farming Drone:**\r\nDesigned for high-resolution field scanning, enabling farmers to assess their crops\' health accurately, improve field management, and ensure higher yield.\r\n\r\n- **Features:**\r\n  - High-resolution RGB and multispectral cameras\r\n  - AI-based plant health analysis\r\n  - Extended flight times\r\n  - GPS and RTK navigation\r\n  - Automated flight paths\r\n  - Weather-resistant design\r\n\r\n**1.2. Crop Spraying Drone:**\r\nTailored for efficient and precise spraying, reducing labor and ensuring that crops receive the correct amount of inputs.\r\n\r\n- **Features:**\r\n  - Precision spray nozzles\r\n  - Intelligent liquid level sensors\r\n  - AI-driven spray optimization\r\n  - Swath coverage recognition\r\n  - Terrain-following radar\r\n\r\n**1.3. Hybrid Drone:**\r\nCombines the features of both the Precision Farming and Crop Spraying drones. Suitable for farms seeking a comprehensive solution.\r\n\r\n- **Features:**\r\n  - Integrated high-resolution cameras and spraying mechanism\r\n  - Dual-function flight mode\r\n  - Intelligent crop health diagnosis and responsive spraying\r\n\r\n**1.4. Data Analysis Module:**\r\nIntegrated software for analyzing the data collected by the drones, providing actionable insights.\r\n\r\n- **Features:**\r\n  - AI-powered pest and disease identification\r\n  - Nutrient deficiency detection\r\n  - Field zoning and prescription mapping\r\n  - Historical data comparison\r\n\r\n**1.5. Accessories and Spare Parts:**\r\nInclude additional batteries, propellers, nozzles, calibration tools, and other essential components.\r\n\r\n---\r\n\r\n2. Services:\r\n\r\n**2.1. Custom Flight Planning:**\r\nCustomized flight plans tailored to individual farms, ensuring full coverage and optimal data collection.\r\n\r\n**2.2. Drone Training:**\r\nComprehensive training sessions for farmers and agricultural professionals on how to operate, maintain, and interpret data from the drones.\r\n\r\n**2.3. Maintenance and Repairs:**\r\nEnd-to-end servicing solutions, from regular maintenance check-ups to repairs, ensuring the drones remain in prime condition.\r\n\r\n**2.4. Data Analysis and Consultation:**\r\nDeep-dive analysis into the data collected, provided by agricultural experts. This includes personalized recommendations on crop management, input application, and harvest planning.\r\n\r\n**2.5. Crop Spraying Services:**\r\nFor farmers without the capability or desire to operate drones, a fully managed crop spraying service is available, deploying trained pilots to apply inputs accurately and efficiently.\r\n\r\n**2.6. Rental Services:**\r\nShort-term and long-term drone rentals for farms that need the technology on an ad-hoc basis.\r\n\r\n**2.7. Integration with Farm Management Systems:**\r\nIntegrating the data and insights generated by the drones into existing farm management software and tools.\r\n\r\n**2.8. 24/7 Support:**\r\nAround-the-clock technical support to troubleshoot any issues or queries related to the drones, software, or any other aspect of the service.\r\n\r\nThese products and services, designed with cutting-edge technology, aim to revolutionize farming, making it smarter, more efficient, and sustainable. By bringing together the prowess of drones and AI, farmers can make data-driven decisions, ensuring improved yields and reduced resource wastage.', NULL, 'https://fposagar.com', 'Information Technology', NULL, NULL, 'on', NULL, 'DEORI', 'Madhya Pradesh', NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, '105083', NULL, 'reject', NULL, NULL, 0, NULL, '', '', '', '', NULL, '0', NULL, 0, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '1', 'Already in the list', 0, NULL, NULL, 0, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, '05/09/2023', NULL, '2021-09-28 08:32:40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', 0, NULL, NULL, 0, NULL, NULL, NULL, NULL),
