INSERT INTO `template_listing` (`id`, `template_name`, `description`, `template_file`, `template_catid`, `delstatus`) VALUES
(6, 'Article of Association', ' Startups often begin with a small team and a flexible structure. An article of association provides a clear framework for decision-making, ownership rights, and operational procedures. It helps establish structure and promotes a cohesive and organized approach within the startup.', 'Articles_of_Association.docx', 2, 1),
(7, 'Form DIN 3', 'Form DIN-3 is a specific form used for the purpose of registering a company and obtaining a Director Identification Number (DIN). ', 'FORM-DIN-3-company_to_the_Registrar.PDF', 2, 1),
(8, 'Form GST REG-01', 'Form GST REG-01 is an application form used for the registration under the Goods and Services Tax (GST) regime. It is used by individuals and businesses to provide essential details and apply for GST registration, which is mandatory for certain businesses as per the GST laws.', 'GST_Form.pdf', 2, 1),
(9, 'Memorandum of Association', 'The Memorandum of Association (MOA) is a legal document that outlines the fundamental objectives and powers of a company, as well as the scope of its operations. Startups use the MOA to establish their purpose, define their activities, and provide clarity on the company\'s goals and direction, ensuring transparency and legal compliance.', 'MEMORANDUM_OF_ASSOCIATION.docx', 2, 1),
(11, 'PAN Form 49A', 'It is used to apply for a PAN card by individuals, including taxpayers, to fulfill their income tax obligations and to serve as a unique identification for financial transactions and official purposes.', 'PAN_Form.pdf', 2, 1),
(12, 'Financial Projection', 'This will provide a detailed outlook on revenue, expenses, and cash flow over a specific period, typically three to five years. These projections help in making informed decisions regarding funding requirements, investment opportunities, and operational strategies', 'Financial_Projection_Sample_.xlsx', 8, 1),
(13, 'Financial Statements', 'Financial statements are comprehensive reports that outline a startup\'s financial performance and position. They assist startups in evaluating their financial health, planning budgets, identifying areas for improvement, and ensuring compliance.', 'Statements.xlsx', 8, 1),
(14, 'Employee Agreement', 'An employee agreement is a legal document used by startups to establish clear expectations, protect their interests, and maintain a professional work environment. It helps mitigate risks, protect confidential information, and promote transparency and clarity among employees.', 'Employee_agreement.docx', 7, 1),
(15, 'Experience Letter', 'An experience letter is an official document given by company to departing employees, serving as proof of their work experience and contributions. It helps employees in future job applications ', 'Experience_Letter.docx', 7, 1),
(16, 'Offer Letter', 'An offer letter is a formal job offer document that outlines key details, such as salary and start date. It establishes clarity and agreement between the employer and the candidate before joining.', 'Offer_Letter.docx', 7, 1),
(17, 'Relieving Letter', 'A relieving letter is an official document provided by an employer to an employee upon their resignation or termination. It confirms the employee\'s departure from the organization and serves as proof of their release from duties, often required for future employment and legal purposes.', 'Relieving_Letter.docx', 7, 1),
(18, 'Salary Slip', 'A salary slip is a document issued by an employer to an employee, providing a detailed breakdown of their salary components, deductions, and net pay for a specific period.', 'Salary-slip-format-formula_(1).xlsx', 7, 1),
(19, 'Bank Resolution', ' A bank resolution is a formal document approved by a company\'s board of directors, authorizing specific actions or decisions related to banking matters.', 'Bank_Resolution_.docx', 3, 1),
(20, 'Website Term & Condition Agreement', 'Website terms and conditions, also known as terms of service or terms of use, are a set of legal agreements that outline the rules and regulations governing the use of a company\'s website. ', 'Website_T.docx', 3, 1),
(21, 'GST Resolution', 'When registering for GST, a company\'s Board of Directors can pass a resolution authorizing an individual to sign and handle all GST-related documents, represent the company in GST matters, and correspond with GST authorities as needed.', 'GST_Resolution.doc.docx', 3, 1),
(22, 'Advisor Agreement', 'This is a  contractual arrangement between a company and an advisor outlining the terms and conditions of their working relationship. It is used to establish the roles, responsibilities, compensation, confidentiality, and other key aspects of the advisory engagement, ensuring clarity and protecting the interests of both parties involved.', 'Advisor_Agreement.docx', 11, 1),
(23, 'Non-Disclosure  Agreement', 'It is used to protect sensitive information or trade secrets shared between parties, ensuring that such information remains confidential and not disclosed to third parties without proper authorization, thereby safeguarding the interests and proprietary rights of the parties involved.', 'NDA.docx', 11, 1),
(24, 'Founders Agreement', 'A founders agreement is a legal document that clarifies roles, ownership, and decision-making among company founders, ensuring a strong foundation and minimizing conflicts.', 'Founders_agreement.docx', 11, 1),
(25, 'Service Agreement', 'Service agreement defines the terms of services between a provider and a client, ensuring clear expectations and legal protection.', 'Service_Agreement.docx', 11, 1),
(26, 'Budget Overview', 'A budget overview is a summary of an organization\'s financial plan, helping allocate resources effectively and assess financial performance.', 'Budget_overview.xlsx', 9, 1),
(27, 'Gantt Chart', 'A Gantt chart is a visual representation of a project\'s schedule that uses horizontal bars to illustrate the start and end dates of tasks or activities.', 'Gantt_Chart.xlsx', 4, 1),
(28, 'Invoice', 'An invoice is a document issued by a seller to a buyer, detailing the products or services provided and the amount owed. It serves as a formal request for payment and provides a record of the transaction for both parties involved.', 'Invoice-Template.xlsx', 10, 1),
(29, 'Purchase Order', 'Purchase order is a document issued by a buyer to a seller, specifying the products or services requested, quantities, prices, and delivery terms. I', 'Purchase_Doc.docx', 10, 1),
(30, 'Idea Validation ', ' Idea validation canvas is a framework that helps entrepreneurs assess the viability of their business ideas by evaluating key components such as problem-solution fit, target market, value proposition, and revenue streams.', 'Idea_Validation_Canvas.docx', 1, 1),
(31, 'Customer Feedback Analysis ', 'customer analysis canvas is a tool used to gain a deeper understanding of the target customers by analyzing their demographics, needs, preferences, behaviors, and pain points. ', 'Customer_feedback_analysis.docx', 1, 1),
(32, 'Financial statement', 'Financial statements are formal reports that provide a snapshot of a company\'s financial performance, including its income, expenses, assets, liabilities, and equity. ', 'Financial_statements.docx', 1, 1),
(33, 'Organizational structure & hierarchy', 'Organizational structure and hierarchy is the formal arrangement of roles, responsibilities, and reporting relationships within an organization. ', 'Organizational_Structure_&_Hierarchy.docx', 1, 1),
(34, 'Quarterly Hiring Plan', 'A quarterly hiring plan is a strategic roadmap that outlines the hiring goals, positions to be filled, and timelines for recruitment activities over a three-month period. ', 'Quarterly_Hiring_Plan.docx', 1, 1),
(35, 'Resource Utilization Sheet', 'Resources utilization sheet is a document that tracks the allocation and utilization of resources, such as employees, equipment, and facilities, within a project or organization. ', 'Resource_Utilization_Sheet.docx', 1, 1),
(36, 'Idea Validation Checklist', 'Idea validation checklist is a tool that outlines a series of criteria and questions to evaluate the feasibility and viability of a business idea. ', 'IDEA_VALIDATION_CHECKLIST.docx', 1, 1),
(37, 'Idea Validation Report', 'Idea validation report is a comprehensive document that summarizes the findings and analysis from the idea validation process. ', 'Idea_Validation_report_(Autosaved).docx', 1, 1),
(38, 'Tentative Customer List', 'Tentative customer list is of potential customers or target market segments that a business intends to engage with. ', 'Tentative_Customer_list.docx', 1, 1),
(39, 'Marketing Plan', 'Marketing plan is a strategic document that outlines the marketing objectives, strategies, and tactics to be implemented by a business to promote its products or services.', 'Marketing_Plan.docx', 1, 1),
(40, 'Go-To-Marketing Strategy', 'Go-to-Market (GTM) strategy outlines the specific approach and tactics a company will employ to bring its products or services to the market successfully. ', 'Go-to-market_strategy_details.docx', 1, 1),
(41, 'Revenue Model', 'Revenue model defines how a company generates revenue by identifying the sources and pricing mechanisms for its products or services. ', 'Updated_Revenue_Model.docx', 1, 1),
(42, 'Pricing Strategy Plan', 'Pricing Strategy plan is a deliberate approach that outlines how a company sets prices for its products or services based on market conditions, costs, and competitive factors. ', 'Pricing_Strategy_Document.docx', 1, 1),
(43, 'Target Market Details', 'Target market refers to the specific group of consumers or businesses that a product or service is intended for. ', 'Target_Market_Details.docx', 1, 1);
